    @Override
    public void onClick(View v) {
        switch (v.getId()) {
            case R.id.zoomin:
                canvasView.zoomIn();
                break;

            case R.id.zoomout:
                canvasView.zoomOut();
                break;

            case R.id.left:
                canvasView.left();
                break;

            case R.id.right:
                canvasView.right();
                break;

            case R.id.up:
                canvasView.up();
                break;

            case R.id.down:
                canvasView.down();
                break;
        }
    }
